import React from 'react'
import styled from 'styled-components'

const Bar = styled.div`
    display: grid;
    grid-template-columns: 1fr 1fr 1fr;
`

export default function(){
    return (
        <Bar>
            <div>Ancrypto</div>
            <div>DashBoard</div>
            <div>Settings</div>
        </Bar>
    )
}
